description:
And a new scanlation team have entered the scene, SweDane. Here is their first work, Yoko Tsuno 12 - Queen of the Deep.

Once again, Yoko and her friends visit the remote planet Vinea, home of the blue-skinned people that once lived below the Earth's surface, and that now have returned to their home planet in the Andromeda galaxy.
Yoko's friend, Khany, tell her the story of a legendary city from the time of the Great Wars, and the discovery of a sleeper pod with a child in suspended animation inside leads them on to find the city, located at the bottom of the ocean like another Atlantis.
They find the city ruled by the evil queen Hegora - the Queen of the Deep.
